bool gGUIResources::isInitialized() {
	return isinitialized;
}

int gGUIResources::getIconWidth() {
	return iconw;
}

int gGUIResources::getIconHeight() {
	return iconh;
}

int gGUIResources::getIconComponentsNum() {
	return iconcomponents;
}

int gGUIResources::getIconNum() {
	return iconnum + bigiconnum;
}

// In any class, a function that allows us to access the images in the array we created.
gTexture* gGUIResources::getIconImage(int iconId, bool isIconBig) {
	if(isIconBig)return bigicon[iconId];
	else return icon[iconId];
}

